async function checkUrl(urlString,w){
    if(urlString!=""){
        var liveRoomReg=/(http|https):\/\/[live.bilibili.com]+(\/[\d]{1,8}?)/g;
        var banReg=/(http|https):\/\/[live.bilibili.com]+\/p\/[html]+/g;
        var ebanReg=/(http|https):\/\/[live.bilibili.com]+\/p\/[eden]+/g;
        if(liveRoomReg.test(urlString)){
            echo.log("你在直播间")
            var roomid=await ROOM_INFO_API.getRid();
            var upid=await ROOM_INFO_API.getUid();
            if(roomid!=0||upid!=0){
                gosrc()
                testPanel()
                changePanel()
                buildstyle1()
                buildlink()
                echoLog(roomid,upid)
                
            }else{
                echo.log("获取不到")

            }
        }else{
            noRightUrl(banReg,ebanReg,apiReg,urlString)
        }
    }
}
