function echoLog(roomid,upid){
    echo.log();
    echo.group( echo.asWarning( "b站信息" ) );
    echo.log( echo.asAlert( "当前直播间号" ),echo.asWarning( roomid) );
    echo.log( echo.asAlert( "up主号" ), echo.asWarning(upid) );
    echo.groupEnd();
    echo.log();
    $.ajax({
        url:"//api.live.bilibili.com/xlive/web-room/v2/index/getRoomPlayInfo?room_id="+roomid+"&no_playurl=0&mask=1&qn=0&platform=web&protocol=0,1&format=0,2&codec=0,1",
        type:"get",
        dataType:"json",
        async: !1,
        timeout:3e3,
        success:function(r){
            isSigned(r)
            showid(r)
            isLiving(r)
        }
    })

}
function getvlc(r){
    let i=0,j=0,k=0;
    let codecName,urlinfo,format,codec,url;
    let stream=r.data&&r.data.playurl_info.playurl.stream;
    while(i<stream.length){
        if (stream[i].protocol_name.indexOf("http_hls")!=-1){
            stream=stream[i];
        }
        i++;
    }
    format=stream.format[j];
    codec=format.codec;
    for (k=0;k<codec.length;k++){
        codecName=codec[k].codec_name;
        url='https://d1--cn-gotcha204.bilivideo.com'+codec[k].base_url.split("?")[0];
        buildlip("<button class='b_vlc_"+k+"' title='复制推流URL'>"+buildi()+"</button><span>"+codecName+": </span><p>"+url+"</p>","#3ab54a","url_"+k);
        clickCopy('.b_vlc_'+k,url)
    }

}
function waterMarker(){
    document.querySelector('.web-player-icon-roomStatus').style.opacity=0;
}
function noRightUrl(banReg,ebanReg,apiReg,urlString){
    if(banReg.test(urlString)){
        echo.log("live/p/html")
        echo.log("你不在直播间html")
    }else if(ebanReg.test(urlString)){
        echo.log("live/p/eden")
        echo.log("你不在直播间eden")
    }else{
        echo.log("你不在直播间")}
}

function start() {
    'use strict';
    var W=typeof unsafeWindow === 'undefined'?window:unsafeWindow;
    var liveurl=W.location.href;
    checkUrl(liveurl,W)
    // Your code here...
}

