//分析
//功能
var lunbo=document.createElement("div");
lunbo.id="lunbo";
function isSigned(r){
    let shortid=r.data.short_id
    let s1="<p style=\"color:#f98280;\">🎀签约主播</p>"
    let s0="<p style=\"color:#25aae2;\">可能不是签约主播</p>"
    if (shortid!=0){
        buildlip(s1,"sign_ornot")
    }else{
        buildlip(s0,"sign_ornot")
    }
}
async function showid(r){
    let roomid,uid,shortid;
    roomid=r.data.room_id
    uid=r.data.uid
    shortid=r.data.short_id
    let a=await BAPI.live_user.get_anchor_in_room(roomid)
    let uname=a.data.info.uname
    buildlips(uname,roomid,shortid,uid)

}
function buildlips(uname,roomid,shortid,uid){
    buildlip("<button class='b_uname' title='复制主播名字'>"+buildi()+"</button><span>主播名叫：</span><p>"+uname+"</p>")
    buildlip("<button class='b_roomid' title='复制房间号'>"+buildi()+"</button><span>房间号：</span><p>"+roomid+"</p>")
    buildlip("<button class='b_shortid' title='复制短位号'>"+buildi()+"</button><span>短位号：</span><p>"+shortid+"</p>")
    buildlip("<button class='b_upid' title='复制UP主号'>"+buildi()+"</button><span>UP主号：</span><p>"+uid+"</p>")
    clickCopy('.b_uname',uname)
    clickCopy('.b_roomid',roomid)
    clickCopy('.b_shortid',shortid)
    clickCopy('.b_upid',uid)
}

//复制
function clickCopy(cn,txt){
    var btn=document.querySelector(cn)
    btn.addEventListener('click',(e)=>{
        GM_setClipboard(txt)
        func('复制成功')
        e.preventDefault();
    })
}

function func(data){
    var style={
        background:"#2AC864",
        position:"fixed",
        padding:"12px 24px",
        zIndex:10,
        right:"10%",
        bottom:"10%",
        borderRadius:"24px",
        color:"white"

    }
    for(var i in style){
        lunbo.style[i]=style[i]
    }
    if(document.getElementById("lunbo")==null){
        // 在body中添加lunbo控件（lunbo在上面创建的）
        document.body.appendChild(lunbo);
        // 显示内容
        lunbo.innerHTML=data;
        // 文本居中
        lunbo.style.textAlign="center";
        // 设置2s后去掉弹出窗
        return new Promise(resolve=>{
            setTimeout(()=>{document.body.removeChild(lunbo)},2000)
        })
    }
}

function isLiving(r){
    var l0="<p style=\"color:green;\">🐸主播未开播</p>"
    var l1="<p style=\"color:red;\">😡主播在直播</p>"
    var l2="<p style=\"color:orange;\">🙄轮播中</p>"
    let ls=r.data.live_status
    switch (ls) {
        case 0:
            $('#sign_ornot').append(l0)
            break;
        case 1:
            $('#sign_ornot').append(l1)
            //去水印
            waterMarker()
            getvlc(r);
            break;
        case 2:
            $('#sign_ornot').append(l2)
            break;
        default:
            buildlip("不知道");
    }
}


//元素


